import React from 'react';
import { connect } from 'react-redux';
import { SPage, SScrollView2, SText, SView } from 'servisofts-component';

class root extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };
    }

    render() {
        return (
            <SPage title={''} hidden disableScroll >

                <SScrollView2>
                    <SView col={"xs-12"} center height backgroundColor={'transparent'}>
                        <SView col={"xs-11"} style={{ height: "100vh" }} backgroundColor={'transparent'} center>
                            <SText style={{ fontSize: 50 }} >root</SText>
                        </SView>
                        <SView col={"xs-11"} flex height backgroundColor={'red'} center>
                            <SText style={{ fontSize: 50 }} >root</SText>
                        </SView>
                    </SView>
                </SScrollView2>

            </SPage >
        );
    }
}
const initStates = (state) => {
    return { state }
};
export default connect(initStates)(root);
